import React from 'react';

const App = () => {
    return(
        <div className='container mt-4'>
            <div className='row'>
                <div className='col-8'>
                    <h1>Lista</h1>
                </div>
                <div className='col-4'>
                    <h1>Formulario</h1>
                </div>
            </div>
        </div>
    )
}

export default App;
